ReactDOM.render(

  <React.StrictMode>
     <BrowserRouter>
     <Routes> 
<Route path = '/' element={<App />}>

</Route>
     </Routes>
    {/* <App /> */}
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
